import React, {useEffect,useState} from 'react';
import './App.css'

function App() {
  const [date,setDate] = useState(new Date());
  useEffect(() => {
     setInterval(() => setDate(new Date()), 1000);
   }, []);

  return(
    <div className="realTime-box">
      {date.toLocaleTimeString()}
    </div>
  )
}

export default App;
